const Latest = () => {
    const onHeaderClick = (e) => {
        e.preventDefault();

        if(e.target.tagName === 'A') 
        {
            let url = new URL(e.target.href);

            console.log(url.pathname);
        }
    };

    return (
        <p> Latest </p>
  );
};
  
export default Latest;
